import React from 'react';

import AddBoxIcon from '@mui/icons-material/AddBox';
import {  Tooltip } from '@mui/material';
import styled from "@emotion/styled";

import './AddStaffButton.css';

const StyledTooltip = styled(({ className, ...other }) => (
  <Tooltip classes={{ tooltip: className }} {...other} />
))`
  font-size: 1vw;
  color: blue;
  background-color: yellow;
`;

const AddStaffButton = () => {

  return (
    <div className='addButton'>
      <Tooltip sx={{
        '& .MuiTooltip-tooltip': {
          bgcolor: 'papayawhip',
          color: '#000',
        }
      }} placement='top' title='Πρόσθεσε Προσωπικό'>
        <button>
          <AddBoxIcon color='inherit' fontSize='inherit'/>
        </button>
      </Tooltip>
    </div>
  );
}

export default AddStaffButton;
